须 先 交卷 . 到 考务 办公室 等候 . 如 有 特殊 情况 的 . 须 获得 监考员 . 巡考员 的 同意 后作 特殊 处理 . 
十一 . 考试 结束 信号 发出 后 . 考生 必须 立即 停止 作答 . 将 试卷 有 文字 的 一面 朝下 放置 桌面上 . 经 监考员 逐个 核查 无误 后 . 方可 逐一 离开 考场 . 

考试 违纪 . 作弊 的 认定 与 处理 
一 . 凡 考试 违纪 或 作弊者 . 该门 课程 记 零分 . 并 根据 情节 轻重 给予 相应 的 纪律处分 . 
二 . 有 下列 情节 之一 者 . 按 违纪 处理 . 视 情节 给予 警告 或 严重 警告 处分 : 
1 . 携带 与 考试 相关 的 资料 . 未 按 要求 放置 到 指定 地点 且 不 听 劝告 者 ; 
2 . 不 服从 监考 人员 安排 . 影响 考场 秩序 者 ; 
3 . 考试 过程 中 互相 交谈 者 ; 
4 . 将 试卷 带 出 考场 者 . 
三 .

有 下列 情节 之一 者 . 按 作弊 处理 . 给予 记过 或 留校察看 处分 : 
1 . 抄袭 书籍 . 笔记 . 纸条 或 他人 试卷 者 . 
2 . 预先 在 桌面 抄写 公式 . 定义 等 与 考试内容 有关 的 文字 . 符号 . 或 把 与 考试 有关 的 资料 藏于 试卷 下者 ; 
3 . 互换 考卷 . 传递 纸条 者 ; 
4 . 以 各种 方式 为 他人 作弊 提供方便 者 ; 
5 . 伪造 . 涂改 学生证 . 准考证 . 身份证 等 证件 者 ; 
6 . 利用 手机 等 通讯 工具 或 其它 电子设备 作弊者 ; 
7 . 考试 过程 中 或 考试 结束 后 纠缠 . 谩骂 . 恐吓 . 威胁 监考 人员 者 . 
四 . 有 下列 情节 之一 者 . 给予 开除 学籍 处分 : 
1 . 请人 代考 或 替 他人 考试 者 ; 
2 . 组织 集体 作弊者 ; 
3 .   违纪 或 作弊 后 . 拒不接受 批评 教育 .
